import React from "react";
import styled from "styled-components";


const WeatherDiv = styled.div `
display: flex;
flex-direction: column;
width: 400px;

`;

const WeatherInfo = styled.div `
text-align: left;
`;

const Span = styled.span `
 font-size: 1.2rem;
`;
const Paragraph = styled.span `
 font-size: 1.4rem;
 font-weight: bolder;
 text-align: center;
`;


function Api(props) {
  return (
    <>
    <WeatherDiv>
      <h1>Lancaster, PA</h1>
      <h4>{props.weather.LocalObservationDateTime}</h4>
      <Paragraph>{props.weather.WeatherText}</Paragraph>
      <WeatherInfo>
      <Span>Temperature: </Span><Paragraph>{props.temperature.Value}</Paragraph><Span>° Fahrenheit</Span>
      <Span>Real Feel: </Span><Paragraph>{props.realFeel.Value}</Paragraph><Span>° Fahrenheit</Span>
      <Span>Humidity: </Span><Paragraph>{props.weather.RelativeHumidity}</Paragraph>
      </WeatherInfo>
    </WeatherDiv>
    </>
  );
}

export default Api;
